ributes":{"args":{"ohlc_range":{"id":"1929420"},"source":{"id":"1929450"},"volume_range":{"id":"1929657"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1929838","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"H4XrUbieXEDD9Shcj1JdQHE9CtejsFxAH4XrUbj+XEBmZmZmZrZdQAAAAAAA0F1AH4XrUbjOXUB7FK5H4fpdQM3MzMzMLF5APQrXo3BdXkAUrkfhevReQD0K16Nw7V5ApHA9CteTXkCF61G4HuVeQMP1KFyPol5ArkfhehSuXkCuR+F6FA5fQEjhehSup19A16NwPQpHX0DXo3A9CjdfQI/C9ShcX19AcT0K16OAX0BSuB6F62FfQFyPwvUoPF9AFK5H4XqkX0DXo3A9ChdgQArXo3A9GmBAexSuR+E6YEAUrkfhekxgQEjhehSuN2BAUrgehesxYEAfhetRuC5gQNejcD0K919ApHA9CtcrYECPwvUoXAdgQGZmZmZmFmBA16NwPQqnX0Bcj8L1KIxeQClcj8L1WF5ACtejcD1KX0AzMzMzMxNfQGZmZmZm9l5AcT0K16OQXkAfhetRuK5eQLgehetR2F5APQrXo3C9X0Bcj8L1KJxfQKRwPQrX419AhetRuB7FX0AUrkfhesRfQHE9CtejoF9Aw/UoXI8CX
